import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import ListSubheader from '@mui/material/ListSubheader';
import IconButton from '@mui/material/IconButton';
import InfoIcon from '@mui/icons-material/Info';
import PropTypes from 'prop-types';

const avilableSizes = [150, 300, 450, 600];

function srcset(image: string, size: number, rows = 1, cols = 1) {
  return {
    src: `${image}?w=${size * cols}&h=${size * rows}&fit=crop&auto=format`,
    srcSet: `${image}?w=${size * cols}&h=${
      size * rows
    }&fit=crop&auto=format&dpr=2 2x`,
  };
}

function TitlebarImageList({ itemData }) {
  const selectedItemData = itemData.slice(0,100);
  selectedItemData.map((element, index) => {
    const arr = element.url.split('/');
    arr[3] = avilableSizes[index%4]
    element.url = arr.join('/');
    element.cols = Math.round(1 + Math.random());
    element.rows = Math.round(1 + Math.random());;
  });

  console.log(selectedItemData); 

  return (
    <ImageList sx={{ width: 500, height: 450 }}
    variant="quilted"
    cols={4}
    rowHeight={121}>
      <ImageListItem key="Subheader" cols={2}>
        <ListSubheader component="div">Aqua Gallery</ListSubheader>
      </ImageListItem>
      {selectedItemData.map((item) => (
        <ImageListItem key={item.url} cols={item.cols || 1} rows={item.rows || 1}>
          <img
            {...srcset(item.img, 121, item.rows, item.cols)}
            alt={item.title}
            loading="lazy"
          />
          <ImageListItemBar
            title={item.title}
            actionIcon={
              <IconButton
                sx={{ color: 'rgba(255, 255, 255, 0.54)' }}
                aria-label={`info about ${item.title}`}
              >
                <InfoIcon />
              </IconButton>
            }
          />
        </ImageListItem>
      ))}
    </ImageList>
  );
}

TitlebarImageList.propTypes = {
  itemData: PropTypes.array,
  };

export default TitlebarImageList;

